import {Modal,Navbar,Nav,Form,Button,FormControl,Card,Container,Row,Col,DropdownButton,Dropdown,Select,Option,Jumbotron,InputGroup} from 'react-bootstrap';
import * as Icon from 'react-bootstrap-icons';
import Headbar from './headbar';
import React, { useState, useEffect } from 'react';
import { useHistory, useParams } from "react-router-dom";

const Editstation = () => {
  const {id} =useParams();
  return (
    <div>
    <Headbar></Headbar>
    <br></br>
    <Container>
          <Row>
          <Col></Col>
          <Col xs="12">
            <Card>
            <Card.Header as="h5">{'แก้ไขสถานที่'+id}</Card.Header>
            <Card.Body>
                
                <form>
                <InputGroup className="mb-3">
                <InputGroup.Prepend>
                <InputGroup.Text>station</InputGroup.Text>
                </InputGroup.Prepend>
                <FormControl/>
                
                </InputGroup>

                
                <Button type="submit" >เพิ่ม</Button>
                
                
                </form>

                

            </Card.Body>
            </Card>
          </Col>
          <Col></Col>
          </Row>
    </Container>
    </div>
  );
}

export default Editstation;
